import React from 'react'
import { useSelector } from 'react-redux'

const Counter = () => {
    const count = useSelector((state)=>state.counter.value)
    const increment = useSelector()
  return (
    <div>
        <button>
            Increment
        </button>
        <p>{count}</p>
        <button>
            Decrement
        </button>
    </div>
  )
}

export default Counter
